import React from "react";
import "./Nav.css";
import mu from "./images/MU.png";

function Nav() {
  return (
    <div className="Nav">
      <a href="#Intro">
        <h1 className="Mu"> MU</h1>
      </a>
      <div className="Nav-links">
        <li>
          <a href="#About-me">About Me</a>
        </li>
        <li>
          <a href="#Projects">Projects</a>
        </li>

        <li>
          <a href="#Resume">Resume</a>
        </li>
        <li>
          <a href="#Contact-me">Contact</a>
        </li>
      </div>
    </div>
  );
}

export default Nav;
